[{"location":"anotherPage.html#The-LogNormals-Module","page":"An other page","title":"The LogNormals Module","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":" LogNormals","category":"page"},{"location":"anotherPage.html#Module-Index","page":"An other page","title":"Module Index","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":"Modules = [LogNormals]\nOrder   = [:constant, :type, :function, :macro]","category":"page"},{"location":"anotherPage.html#Detailed-API","page":"An other page","title":"Detailed API","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":"Modules = [LogNormals]\nOrder   = [:constant, :type, :function, :macro]","category":"page"},{"location":"anotherPage.html#LogNormals.AbstractMoments","page":"An other page","title":"LogNormals.AbstractMoments","text":"AbstractMoments\n\nA representation of statistical moments of a distribution\n\nThe following functions are supported\n\nlength(M::AbstractMoments): get the number of defined moments\n\nThe following getters return a single moment or  throw an error if the moment has not been defined\n\nmean(M::AbstractMoments): get the mean\nvar(M::AbstractMoments): get the variance\nskewness(M::AbstractMoments): get the variance\nkurtosis(M::AbstractMoments): get the variance\ngetindex(M::AbstractMoments,i): get the ith moment, i.e. indexing m[i]\n\nThe basic implementation 'Moments' is immutable and convert(AbstractArray, M::Moments) returns an SArray{N,T}\n\nExamples\n\nM = Moments(1,0.2)\nlength(M) == 2\nvar(M) == M[2]\nismissing(kurtosis(M))\ntypeof(convert(AbstractArray,M)) <: AbstractArray\n\n\n\n\n\n","category":"type"},{"location":"anotherPage.html#StatsBase.fit-Tuple{Type{Distributions.LogNormal},AbstractMoments}","page":"An other page","title":"StatsBase.fit","text":"fit(Distribution, m::Moments)\n\nFit a statistical distribution to its moments \n\nArguments\n\nDistribution: The type of distribution to fit\nm: The moments of the distribution\n\nNotes\n\nThis can be used to approximate one distribution by another\n\nExamples\n\nD = fit(LogNormal, Moments(3.2,4.6))\nD = fit(LogNormal, moments(Normal(3,1)))\nplot(D); lines(!Normal(3,1))\n\n\n\n\n\n","category":"method"},{"location":"anotherPage.html#StatsBase.fit-Tuple{Type{Distributions.LogNormal},QuantilePoint,QuantilePoint}","page":"An other page","title":"StatsBase.fit","text":"fit(Distribution, lower::QuantilePoint, upper::QuantilePoint)\n\nFit a statistical distribution to a set of quantiles \n\nArguments\n\nDistribution: The type of distribution to fit\nlower:  lower QuantilePoint (p,q)\nupper:  upper QuantilePoint (p,q)\n\nNotes\n\nSeveral macros help to construct QuantilePoints @qp(p,q)       QuantilePoint(p, q) @qpll(q0025) quantile at very low p = 0.025  @qpl(q005)   quantile at low p = 0.05  @qpm(median)  quantile at median: p = 0.5  @qpu(q095)   quantile at high p = 0.95  @qpuu(q0_975) quantile at very high p = 0.975 \n\nExamples\n\nDN = fit(Normal, @qp_m(3), @qp_uu(5))\nD = fit(LogNormal, @qp_m(3), @qp_uu(5))\nquantile.(D, [0.5, 0.975]) ≈ [3,5]\n\n\n\n\n\n","category":"method"},{"location":"anotherPage.html#StatsBase.fit-Union{Tuple{stats}, Tuple{Type{var\"#s20\"} where var\"#s20\"<:Distributions.Distribution,Real,QuantilePoint}, Tuple{Type{var\"#s21\"} where var\"#s21\"<:Distributions.Distribution,Real,QuantilePoint,Val{stats}}} where stats","page":"An other page","title":"StatsBase.fit","text":"fit(Distribution, val::Real, qp::QuantilePoint, ::Val{stats} = Val(:mean))\n\nFit a statistical distribution to a quantile and given statistics\n\nArguments\n\nDistribution: The type of distribution to fit\nval: The value of statistics\nqp: QuantilePoint(p,q)\nstats Which statistics to fit: defaults to Val(:mean). Alternatives: Val(:mode)\n\nExamples\n\nD = fit(LogNormal, 5, @qp_uu(14))\nmean(D) ≈ 5 && quantile(D, 0.975) \nD = fit(LogNormal, 5, @qp_uu(14), Val(:mode))\nmode(D) ≈ 5 && quantile(D, 0.975) \n\n\n\n\n\n","category":"method"},{"location":"index.html#LogNormals.jl","page":"Index","title":"LogNormals.jl","text":"","category":"section"},{"location":"index.html","page":"Index","title":"Index","text":"Documentation for LogNormals.jl","category":"page"},{"location":"index.html","page":"Index","title":"Index","text":"see the github repository.","category":"page"}]
